import axios from "axios";
import React, { useEffect, useState } from "react";

const Maincard = () => {
  const [todos, setTodos] = useState();
  useEffect(() => {
    axios.get(`https://api.tvmaze.com/shows`).then((res) => {
      const resposeTodos = res.data;
      setTodos(resposeTodos);
    });
  }, []);
    console.log(todos);
    //const {name, genres, language} = todos;
  return (
    <>
      {todos.map(todo => {
          const{name, genre, id} = todo;
          return(
              <div>
                  <h2>{name}</h2>
              <h2>{genre}</h2>
              <h2>{id}</h2>
              </div>
          )
      })}
    </>
  );
};
export default Maincard;
